mixpanel.init("351207bfbced89d26cc65f5d017d29c3");

String.prototype.capitalize = function() {
    return this.charAt(0).toUpperCase() + this.slice(1);
};

function track(host, path, title) {
    path = path.replace(path.substring(0, 4), "");
    title = title.capitalize();
    var host_path_title = host + '|' + path + '|' + title;
    var viewed = localStorage[host_path_title] || false;
    if (!viewed && path.length > 1) {
        mixpanel.track(host,
            {
                'path_title': path + "|" + title,
            });
        localStorage[host_path_title] = true;
    }
}

function getCookie(cname) {
    var name = cname + "=";
    var ca = document.cookie.split(';');
    for (var i = 0; i < ca.length; i++) {
        var c = ca[i];
        while (c.charAt(0) == ' ') {
            c = c.substring(1);
        }
        if (c.indexOf(name) == 0) {
            return c.substring(name.length, c.length);
        }
    }
    return "";
}
